package main

import (
	"fmt"
	"strconv"
)

func compute_prod(s string) (int, error) {
	prod := 1
	for i := 0; i < len(s); i++ {
		n, err := strconv.Atoi(string(s[i]))
		if err != nil {
			return -1, err
		}
		prod *= n
	}
	return prod, nil
}

func main() {
	num := ""
	run_len := 13

	max_prod := 0
	for i := 0; i <= len(num)-run_len; i++ {
		prod, err := compute_prod(num[i : i+run_len])
		if err != nil {
			fmt.Println("error")
			return
		}

		if prod > max_prod {
			max_prod = prod
		}
	}

	fmt.Println(max_prod)
}
